      super();
      this.state ={
        name : "Reda Eskouni"
      }
    }
    change_style(event){
      this.setState((e)=>{
        styling : {return e.name + " Name Are Cli "}
      })
    }
    
    render(){
      return (
          <header>
            {this.state.name}
          </header>
      );
    }
}

export default Header;
